body: |-
  <div>
  <p>Hallo Herr Edenhofer,</p><p>&nbsp;</p><p>möglicherweise haben wir für unsere morgige Veranstaltung ein Problem mit unserer Develop-Umgebung.<br> Der Kollege Smith wollte uns noch die Möglichkeit geben, direkt auf die Datenbank zugreifen zu können, hierzu hat er Freitag noch einige Einstellungen vorgenommen und uns die Zugangsdaten mitgeteilt. Eine der Änderungen hatte aber offenbar zur Folge, dass ein Starten der Develop-Anwendung nicht mehr möglich ist (s. Fehlermeldung)<br>
  <img src="cid:image002.png@01CDD14F.29D467A0" style="width:577px;height:345px;"></p><p>&nbsp;</p><p>Herr Smith ist im Urlaub, er wurde von seinen Datenbank-Kollegen kontaktiert aber offenbar lässt sich nicht mehr 100%ig rekonstruieren, was am Freitag noch verändert wurde.<br> Meinen Sie, dass Sie uns bei der Behebung der o. a. Störung morgen helfen können? Die Datenbank-Kollegen werden uns nach besten Möglichkeiten unterstützen, Zugriff erhalten wir auch.</p><p>&nbsp;</p><p>Mit freundlichen Grüßen</p><p>&nbsp;</p><p><span>Alex Smith<br>
  </span><span><br>
  </span><span>Abteilung IT-Strategie, Steuerung &amp; Support<br> im Bereich Informationstechnologie<br>
  <br> Example – Example GmbH<br> (Deutsche Example)<br> Longstreet 5<br> 11111 Frankfurt am Main<br>
  <br> Telefon: (069) 11 1111 – 11 30</span></p><p><span>Telefon ServiceDesk: (069) 11 1111 – 12 22<br> Telefax: (069) 11 1111 – 14 85<br> Internet: </span><span style="color:navy;"><a href="http://www.example.com/" title="http://www.example.com/" rel="nofollow noreferrer noopener" target="_blank">www.example.com</a></span></p><p>&nbsp;</p><span class="js-signatureMarker"></span><p>-----Ursprüngliche Nachricht-----<br> Von: Martin Edenhofer via Znuny Sales [mailto:example@znuny.com] <br> Gesendet: Freitag, 30. November 2012 13:50<br> An: Smith, Alex<br> Betreff: Agenda [Ticket#11995]</p><p>&nbsp;</p><p>Sehr geehrte Frau Smith,</p><p>&nbsp;</p><p>ich habe (wie telefonisch avisiert) versucht eine Agenda für nächste Woche zusammen zu stellen.</p><p>&nbsp;</p><p>Leider ist es mir dies Inhaltlich nur unzureichend gelungen (es gibt zu wenig konkrete Anforderungen im Vorfeld :) ).</p><p>&nbsp;</p><p>Dadurch würde ich gerne am Dienstag als erste Amtshandlung (mit Herrn Molitor im Boot) die Anforderungen und Ziele der zwei Tage, Mittelfristig und Langfristig definieren. Aufgrund dessen können wir die Agenda der zwei Tage fixieren. Inhaltlich können wir (ich) alles abdecken, von daher gibt es hier keine Probleme. ;)</p><p>&nbsp;</p><p>Ist dies für Sie so in Ordnung?</p><p>&nbsp;</p><p>Für Fragen stehe ich gerne zur Verfügung!</p><p>&nbsp;</p><p>Ich freue mich auf Dienstag,</p><p>&nbsp;</p><p>Martin Edenhofer</p><p>&nbsp;</p><p>--</p><p>Enterprise Services for OTRS</p><p>&nbsp;</p><p>Znuny GmbH // Marienstraße 11 // 10117 Berlin // Germany</p><p>&nbsp;</p><p>P: +49 (0) 30 60 98 54 18-0</p><p>F: +49 (0) 30 60 98 54 18-8</p><p>W: <a href="http://znuny.com" rel="nofollow noreferrer noopener" target="_blank"><span style="color:windowtext;">http://znuny.com</span></a>
  </p><p>&nbsp;</p><p>Location: Berlin - HRB 139852 B Amtsgericht Berlin-Charlottenburg Managing Director: Martin Edenhofer</p></div><div>
  <p>-------------------------------------------------------------------------------------------------</p><p>Rechtsform: GmbH</p><p>Geschaeftsfuehrer: Dr. Carl Heinz Smith, Dr. Carsten Smith</p><p>Sitz der Gesellschaft und Registergericht: Frankfurt/Main, HRB 11111</p><p>Alleiniger Gesellschafter: Bundesrepublik Deutschland,</p><p>vertreten durch das XXX der Finanzen.</p></div>
content_type: text/html
